import React from 'react';

const Status = () => {

    const file = "https://merced-my.sharepoint.com/personal/ewaring_ucmerced_edu/_layouts/15/Doc.aspx?sourcedoc={2a8df419-b795-4af8-a72c-8ac6dff22508}&amp;action=embedview";
    return (
     <div>
      <h1>Embedded Visio File</h1>
      <iframe src={file} width="402px" height="327px" frameborder="0">
        This is an embedded
         <a target="_blank" href="https://office.com">Microsoft Office</a>
          diagram, powered by <a target="_blank" href="https://office.com/webapps">Office</a>.
          </iframe>
    </div>
    );
}

// Define styles
const containerStyle = {
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
    height: '600px',
};

const imageStyle = {
    width: '75%',
    height: '100%',
};
export default Status;
